import React from 'react';

function App() {
  return (
    <React.Fragment className="App">
      <nav class="navbar navbar-light bg-light">
        <a class="navbar-brand" href="#">
          <img src="/docs/4.4/assets/brand/bootstrap-solid.svg" width="30" height="30" alt="" />
        </a>
      </nav>
    </React.Fragment>
  );
}

export default App;
